    {
        return new Twig_Source("{% extends 'native.html.twig' %}
{% set message = message %}
{% set listanime = anime %}

         {% block stylesheets %}
            <link href=\"{{ asset('assets/css/style.css') }}\" rel=\"stylesheet\">
            <link href=\"//maxcdn.bootstrapcdn.com/bootstrap/4.1.1/css/bootstrap.min.css\" rel=\"stylesheet\" id=\"bootstrap-css\">
            <script src=\"//maxcdn.bootstrapcdn.com/bootstrap/4.1.1/js/bootstrap.min.js\"></script>
            <script src=\"//cdnjs.cloudflare.com/ajax/libs/jquery/3.2.1/jquery.min.js\"></script>
        {% endblock %}

{% block body_home %}

    {# ajouter un formulaire #}
    <div class=\"container\">
        {{ form_start(form) }}

        <div class=\"form-group\">
            {{ form_label(form.anime) }}
            {{ form_widget(form.anime, {'attr':{'class':'c-input'}}) }}
            {{ form_errors(form.anime) }}
        </div>
        <div class=\"form-group\">
            {{ form_label(form.episode) }}
            {{ form_widget(form.episode, {'attr':{'class':'c-input'}}) }}
            {{ form_errors(form.episode) }}
        </div>
        <div class=\"form-group\">
            {{ form_label(form.url) }}
            {{ form_widget(form.url, {'attr':{'class':'c-input'}}) }}
            {{ form_errors(form.url) }}
        </div>
        
        <input type=\"submit\" value=\"Send\" class=\"c-input\"/>
        {{ form_end(form) }}
    </div>

    {# ajouter un flashbag, oublie pas aussi dans le controller #}
    {% for flashMessage in app.session.flashbag.get('notice') %}
        <br />
        <div class=\"alert alert-success\">
            {{ flashMessage }}
        </div>
    {% endfor %}
    <script src=\"../js/main.min.js\"></script>
{% endblock %}", "add/add-video.html.twig", "C:\\xampp\\htdocs\\airi\\templates\\add\\add-video.html.twig");
